import React, { useState } from "react";
import { Link } from "react-router-dom";
import languageCountryPairs from "./languageCountryPairs";
import "../style.css"; // Import CSS file for global styles

// Separate MovingButton component
const MovingButton = () => {
  const [isRight, setIsRight] = useState(true);

  const handleClick = () => {
    setIsRight(prevState => !prevState);
  };

  return (
    <button
      onClick={handleClick}
      style={{
        backgroundColor: isRight ? "gray" : "blue",
        position: "absolute",
        left: isRight ? "10px" : "calc(100% - 110px)",
        transition: "left 0.5s ease",
      }}
    >
      Click me!
    </button>
  );
};

function Header() {
  const [dropdownVisible, setDropdownVisible] = useState(false);
  const [modelOpen, setModelOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownVisible(!dropdownVisible);
  };

  return (
    <div className="sticky-top bg-white">
      <div className="navbar">
        <div>
          <img src="./img/download.png" alt="logo" className="navbar-logo" />
        </div>
        <div className="search-bar-container">
          {/* Search bar JSX */}
        </div>
        <div className="profile-container">
          {/* Profile JSX */}
          {modelOpen && (
            <div className="modal-container">
              {/* Modal JSX */}
            </div>
          )}
          <div className="btn">
            <MovingButton />
            {/* Other buttons JSX */}
          </div>
        </div>
      </div>
      <hr className="horizontal-rule" />
    </div>
  );
}

export default Header;
